(460, 'options_slider_nosotros_0_descripcion_slider_hero', '<p class=\"subtitulo\"><strong>Disfruta de una actividad memorable con tus compañeros de trabajo en un ambiente lúdico y motivador.</strong></p>\r\n<p class=\"parrafo\">Desarrollamos eventos dirigidos a incrementar la socialización, fomentar la competitividad o aumentar los conocimientos, nos \"centramos\" en el factor que queraís resaltar y nos adaptamos a la temática que mas os convenga.</p>\r\n\r\n<ul>\r\n 	<li>item 1</li>\r\n 	<li>item 2</li>\r\n 	<li>item3</li>\r\n</ul>', 'no'),
