(474, 'options_slider_nosotros_1_descripcion_slider_nosotros', '<p class=\"subtitulo\">Disfruta de una actividad memorable con tus compañeros de trabajo en un ambiente lúdico y motivador.</p>\r\n\r\n<ul>\r\n 	<li>Salimos al parque</li>\r\n 	<li>Vamos para la playa</li>\r\n 	<li>Vamos a la montaña</li>\r\n</ul>\r\nDesarrollamos eventos dirigidos a incrementar la socialización, fomentar la competitividad o aumentar los conocimientos, nos \"centramos\" en el factor que queraís resaltar y nos adaptamos a la temática que mas os convenga.', 'no'),
